import React, { useState, useContext } from "react";
import { Link, useParams } from "react-router-dom";
import { tenants } from "../data";
import { Context } from "../Context";

function Tenant() {
  //get tenantid from url
  const tenantId = useParams();
  //Context: tenants array
  const { tenantsState } = useContext(Context);
  //get tenant object specific to the tenant id
  const tenantObject = tenantsState.find((tenant) => {
    return tenants.tenantid === tenantId;
  });
  //destructure tenant object
  const {
    tenantid,
    tenantName,
    timeRemaining,
    status,
    institution,
    latestScore,
  } = tenantObject;

  return (
    <div className="tenant-container">
      <section className="tenant-header">
        <div>{tenantName}</div>
      </section>
      <section className="tenant-content">{latestScore}</section>
      <Link to={`/tenant/fbChecklist/${tenantId}`}>Conduct Audit</Link>
    </div>
  );
}

export default Tenant;
